import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Main: React.FC = () => {
    const mainData = async () => {
        try {
            const res = await fetch("http://localhost:1234/getData", {
                method: "POST",
                mode: "cors",
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ request: "getData" }) // JSON 형식으로 수정
            });

            const data = await res.json();
            console.log(data);

        } catch (err) {
            console.log("ERROR:", err);
        }
    };

    useEffect(() => {
        mainData();
    }, []); // 빈 배열을 두 번째 인자로 전달하여 컴포넌트가 마운트될 때 한 번만 실행되도록 함

    return (
        <div id="center">
            helloworld
        </div>
    );
};

export default Main;
